import React, { useState } from 'react';
import './FuelQuoteForm.css'; // Import the CSS file

const Register = () => {
  const [password, setPassword] = useState('');
  const [confirmPassword, setConfirmPassword] = useState('');

  const handlePasswordChange = (e) => {
    setPassword(e.target.value);
  };

  const handleConfirmPasswordChange = (e) => {
    setConfirmPassword(e.target.value);
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    if (password !== confirmPassword) {
      alert("Passwords don't match");
      return;
    }
    // Handle registration logic
  };

  return (
    <div className="form-container"> {/* Apply form-container class */}
      <h2 className="title">Register</h2> {/* Apply title class */}
      {/* Register Form */}
      <form className="fuel-quote-form" onSubmit={handleSubmit}> {/* Apply fuel-quote-form class */}
        <div className="form-group">
          <label htmlFor="username">Username:</label>
          <input type="text" id="username" className="retrieve-address" /> {/* Apply retrieve-address class */}
        </div>
        <div className="form-group">
          <label htmlFor="password">Password:</label>
          <input type="password" id="password" className="retrieve-address" value={password} onChange={handlePasswordChange} /> {/* Apply retrieve-address class */}
        </div>
        <div className="form-group">
          <label htmlFor="confirmPassword">Confirm Password:</label>
          <input type="password" id="confirmPassword" className="retrieve-address" value={confirmPassword} onChange={handleConfirmPasswordChange} /> {/* Apply retrieve-address class */}
        </div>
        <button type="submit">Register</button>
      </form>
    </div>
  );
};

export default Register;
